using Microsoft.AspNetCore.Mvc;
using SolaERP.Infrastructure.Contracts.Services;

namespace SolaERP.API.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class FileController : ControllerBase
    {
        private readonly IFileService _fileService;

        public FileController(IFileService fileService)
        {
            _fileService = fileService;
        }

        [HttpGet]
        public async Task<IActionResult> Test()
        {
            ConfigurationManager manager = new();

            manager.SetBasePath(Directory.GetCurrentDirectory());
            manager.AddJsonFile("appsettings.json");

            await _fileService.UploadBase64PhotoWithNetworkAsync($@"",
                manager["FtpServer:FTPServerAdress"], manager["FtpServer:FTPUserName"], manager["FtpServer:FTPPassword"], manager["FtpServer:FtpFolderPath"]);
            return Ok();
        }
    }
}
